import React from 'react';
import {useState} from "react";
import MyButton from "../UI/button/MyButton";
import MyInput from "../UI/input/MyInput";
import UsersList from "../usersList";


function Users() {

    const [users, setUsers] = useState([
        {id: 0, username: "Valera", testData: "01-01-21", speed: 280, accuracy: 99},
        {id: 1, username: "SpiderMan", testData: "02-02-21", speed: 270, accuracy: 88},
        {id: 1, username: "Mira", testData: "03-03-21", speed: 260, accuracy: 77},
        {id: 1, username: "Samantha", testData: "04-04-21", speed: 250, accuracy: 99},
        {id: 1, username: "Patricia Lebsack", testData: "05-05-21", speed: 240, accuracy: 88},
        {id: 1, username: "Oleg", testData: "06-06-21", speed: 230, accuracy: 77},
        {id: 1, username: "Mrs. Dennis Schulist", testData: "07-07-21", speed: 220, accuracy: 99},
        {id: 2, username: "Kostya_888", testData: "08-08-21", speed: 210, accuracy: 88},
        {id: 3, username: "Ervin Howell", testData: "09-09-21", speed: 200, accuracy: 77},
    ]);


    return (
        <div className="App">
            <form>
                <MyInput type="text" placeholder="название"/>
                <MyInput type="text" placeholder="тема"/>
                <MyButton>Пройти Тестирование</MyButton>
            </form>
            <UsersList users={users} title={"Список участников"}/>
        </div>
    )};



export default Users;
